import React from "react"

const HeaderMenu = ({ children }) => {
    return (
        <div
            style={{
                backgroundColor: 'red'
            }}
        >
            {children}
        </div>
    )
}

const Item = ({ children }) => {
    return React.cloneElement(children, {
        fontSize: 24,
        style: {

        backgroundColor: 'blue'
        }
    })
}

export {
    Item
}

export default HeaderMenu
